机，因为火箭是放在电动机顶面上做圆周运动，根据圆周运动离心力计算公式可知，离心力的大小与半径成反比，而火箭要达到入轨要求，需要达到非常高的速度，如果圆周轨道半径小的话，火箭体受到的离心力将非常巨大所以必须加大圆周半径。火箭在三相电机转子顶面上进行加速，加速到十几公里每秒的速度后，再放松火箭与电动机之间约束，让其顺着与电动机转子顶面相切的轨道甩出。为避免火箭体穿过大气层的距离过长，火箭甩出轨道经过水平段之后进入竖曲线段，使火箭经过发射出口时的初速与水平面保持一定的角度。\n3、本次设想的火箭与一般的火箭不同，一般的火箭，其燃料是用于驱动火箭飞行的，本设想的火箭，其燃料是用于入轨后调整轨道，保持卫星在轨道上正确位置使用，火箭是完全依靠在地面上加速到非常高的速度后，冲破大气层，直接入轨。\n4、本设想的电机采用三相高压工频电源，由于体积和重量巨大，定子和转子可以在工厂分件预制，运到现场再安装，定子在里面，转子在外面，定子的中间是空心部分。可以在选定的发射场上圆环形的坑道，将转子与定子安装好后，在坑道上面砌上盖板。为减轻发动机转动的空气阻力，电动机运转时，坑道内必须进行抽真空。\n5、当电动机达到规定转速后，解除火箭体与电动机的约束，火箭将沿着与电动机转子圆周相切的廊道朝出口方向移动，为避免火箭体与廊道侧面产生摩擦，在火箭体上加上超导线圈，在廊道内壁粘贴强力磁片，利用超导线圈与磁片之间的磁排斥力使两者脱离接触。在廊道出口处设有塑料罩，其作用是防止空气进入廊道。当高速移动的火箭体到达出口时，塑料罩将被火箭头部刺穿，刺穿后火箭进入大气层直到入轨。塑料罩为一次性用口，再次发射时，要重新加盖塑料罩并将进入电机内部的空气抽除。'),(1774,'炎炎夏日',1391070463,'2021-02-24 20:04:53','合成大水瓜'),(1775,'炎炎夏日',1391070463,'2021-02-25 08:43:48','pinnnm'),(1776,'雅爱方雏丶Hikari',2311546114,'2021-02-25 10:34:33','pinnnb'),(1777,'Soulstar。',1374723172,'2021-02-25 10:34:44','pronhub'),(1778,'KGAMEJOKER',736193679,'2021-02-25 10:34:56','pinnhub'),(1779,'KGAMEJOKER',736193679,'2021-02-25 13:22:39','我是个傻逼'),(1780,'血璃猫ver.1906',2019766667,'2021-02-25 13:22:48','@1374723172 '),(1781,'血璃猫ver.1906',2019766667,'2021-02-25 13:22:56','神奇'),(1782,'Thaumy',1951327599,'2021-02-25 19:14:04','这他妈睡觉还真是爱好'),(1783,'Thaumy',1951327599,'2021-02-25 20:32:58','我姥电脑盘不够了'),(1784,'Thaumy',1951327599,'2021-02-25 20:33:05','这他妈碎片42'),(1785,'Thaumy',1951327599,'2021-02-25 20:33:18','系统用了六年'),(1786,'炎炎夏日',1391070463,'2021-02-25 23:08:18','pinncnm'),(1787,'炎炎夏日',1391070463,'2021-02-26 01:47:42','睡你麻痹'),(1788,'KGAMEJOKER',736193679,'2021-02-26 14:38:17','淄博咋样'),(1789,'KGAMEJOKER',736193679,'2021-02-26 14:38:26','现在适不适应'),(1790,'Soulstar。',1374723172,'2021-02-26 14:38:37','自行体会'),(1791,'KGAMEJOKER',736193679,'2021-02-26 14:38:50','感觉没荣成强'),(1792,'Soulstar。',1374723172,'2021-02-26 14:38:57','那他妈当然'),(1793,'KGAMEJOKER',736193679,'2021-02-26 18:17:20','我把那本书看成了高考考研'),(1796,'血璃猫ver.1906',2019766667,'2021-02-26 22:34:51','生成的'),(1797,'血璃猫ver.1906